import React from 'react';
import { useNavigate } from 'react-router-dom';

function Dashboard() {
  console.log('Dashboard component rendered');
  const navigate = useNavigate();
  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', height: '100vh', backgroundColor: '#f0f0f0' }}>
      <h1 style={{ fontSize: '2rem', fontWeight: 'bold', marginBottom: '2rem', color: '#333' }}>ParkSense Admin Dashboard</h1>
      <div style={{ display: 'flex', gap: '1rem' }}>
        <button
          onClick={() => navigate('/current-logs')}
          style={{ padding: '0.5rem 1rem', backgroundColor: '#3b82f6', color: 'white', borderRadius: '0.25rem', border: 'none', cursor: 'pointer' }}
        >
          Current Logs
        </button>
        <button
          onClick={() => navigate('/previous-logs')}
          style={{ padding: '0.5rem 1rem', backgroundColor: '#22c55e', color: 'white', borderRadius: '0.25rem', border: 'none', cursor: 'pointer' }}
        >
          Previous Logs
        </button>
        <button
          onClick={() => navigate('/slots')}
          style={{ padding: '0.5rem 1rem', backgroundColor: '#8b5cf6', color: 'white', borderRadius: '0.25rem', border: 'none', cursor: 'pointer' }}
        >
          Slots Details
        </button>
      </div>
    </div>
  );
}

export default Dashboard;
